import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-resultado-reporte',
  templateUrl: './resultado-reporte.component.html',
  styleUrls: ['./resultado-reporte.component.scss']
})
export class ResultadoReporteComponent {
  folio: string | null = null;
  reporte: any = null;

  ngOnInit(): void {
    this.folio = this.route.snapshot.paramMap.get('folio');

    this.reporte = {
      folio: this.folio,
      nombre: 'Juan Pérez',
      telefono: '5551234567',
      categoria: 'Fuga de agua',
      ubicacion: 'Google Maps: https://maps...',
      fecha: '2024-12-01',
      estado: 'En proceso'
    };
  }

  constructor(private route: ActivatedRoute) { }

  descargarPDF() {
    alert('PDF generado');
  }
}
